import React from 'react';
import { Col, Card } from 'react-bootstrap';
import PropTypes from 'prop-types';

function Freelancer(props) {
  let {
    freelancer
  } = props;

  return (
    <Col
      lg={3}
      md={4}
      sm={6}>
      <Card className="freelancer">
        <div className="product-img-wrapper">
          <a href="#">
            <img
              alt={freelancer.name}
              className="img-responsive product-img"
              src={freelancer.thumbnail} />
          </a>
        </div>

        <h4
          className="ellipsis"
          title={freelancer.name}>
          <a href="#">
            {freelancer.name}
          </a>
        </h4>

        <h5
          className="ellipsis product-brand-name"
          title={freelancer.job_title}>
          {`by ${freelancer.job_title}`}
        </h5>

        <div className="pull-right h4 product-price">
          {`${freelancer.full_day_rate}$`}
        </div>
      </Card>
    </Col>
  );
}

Freelancer.propTypes = {
  freelancer: React.PropTypes.isRequired
};

export default Freelancer;
